import React from "react";

const Navigation = () => {
  return (
    <div className="payment">
      <p>残高</p>
      <button>更新</button>
      <button>チャージ</button>
      <button>利用履歴</button>
      <p>ポイント</p>
      <button>更新</button>
      <button>ポイント選択</button>
    </div>
  );
};

export default Navigation;
